    false,nt"url": null,nt"notes": "This data set contains BOEM Planning Area
    outlines in ESRI Arc/Info export and Arc/View shape file formats for the BOEM Pacific
    Region. The use of Planning Areas makes it easier to refer to Official Protraction
    Diagrams (OPD) and individual blocks within a region. The digital Planning Area
    outlines were constructed from the block coverage by using Arc/Info s dissolve command.
    Because GIS projection and topology functions can change or generalize coordinates,
    these GIS files are NOT an OFFICIAL record for the exact Planning Area boundaries.",nt"license_title":
